#include <bits/stdc++.h>
using namespace std;

using ll = long long;

ll solve(const vector<ll> &a)
{
    int n{(int) a.size()};
    cerr << "n = " << n << '\n';
    ll max_sum{};
    for (int i{}; i < n; ++i) {
        for (int j{i}; j < n; ++j) {
            ll sum{};
            for (int k{}; k < i; ++k) {
                sum += a[k];
            }
            ll product{1};
            for (int k{i}; k <= j; ++k) {
                product *= a[k];
            }
            sum += product;
            for (int k{j + 1}; k < n; ++k) {
                sum += a[k];
            }
            cerr << "Result for " << i << " to " << j << " = " << sum << '\n';
            max_sum = max(max_sum, sum);
        }
    }
    return max_sum;
}

ll solve_2(const vector<ll> &a)
{
    int n{(int) a.size()};
    vector<ll> sum(1 + n), product(1 + n);
    product[0] = 1;
    for (int i{1}; i <= n; ++i) {
        sum[i] = sum[i - 1] + a[i - 1];
        product[i] = product[i - 1] * a[i - 1];
    }
    for (ll i: product) {
        cerr << i << ", ";
    }
    cerr << '\n';
    int i{1};
    while (i <= n && product[i] <= 2) {
        ++i;
    }
    --i;
    if (i > 0 && a[i] == 2) {
        --i;
    }
    int j{n};
    while (j > 0 && product[n] / product[j - 1] <= 2) {
        cerr << "j = " << j << " product = " << product[n] / product[j] << '\n';
        --j;
    }
    if (j + 1 <= n && a[j + 1] == 2) {
        ++j;
    }
    cerr << i << " - " << j << '\n';
    if (i == n) {
        return sum[n];
    }
    ll max_result{product[n]};
    ll result{sum[i] + product[n] / product[i]};
    if (result > max_result) {
        max_result = result;
    }
    result = product[j] + sum[n] - sum[j];
    if (result > max_result) {
        max_result = result;
    }
    if (i < j) {
        result = sum[i] + product[j] / product[i] + sum[n] - sum[j];
        if (result > max_result) {
            max_result = result;
        }
    }
    return max_result;
}

int main()
{
    mt19937 g(chrono::system_clock::now().time_since_epoch().count());
    uniform_int_distribution<int> n_distribution(1, 6);
    uniform_int_distribution<int> a_distribution(1, 10);
    ll sum{}, sum_2{};
    while (true) {
        int n{n_distribution(g)};
        vector<ll> a(n);
        for (ll &i: a) {
            i = a_distribution(g);
        }
//        n = 8;
//        a = {4, 7, 4, 6, 5, 10, 7, 6};
        sum = solve(a);
        sum_2 = solve_2(a);
        if (sum != sum_2) {
            cout << a.size() << '\n';
            for (const ll &i: a) {
                cout << i << ' ';
            }
            cout << '\n';
            cout << sum << " vs " << sum_2 << '\n';
            break;
        }
    }
    return 0;
}

import sys
import math

def lcm(arr):
    if len(arr) == 0:
        raise ValueError(" ")
    
    lcm = arr[0]
    for i in range(1, len(arr)):
        lcm = lcm * arr[i] // math.gcd(lcm, arr[i])
    
    return lcm

def gcd(arr):
    if len(arr) == 0:
        raise ValueError(" ")
    
    gcd = arr[0]
    for i in range(1, len(arr)):
        gcd = math.gcd(gcd, arr[i])
    
    return gcd

