void Menu2(double *feldX, double *feldY, int *pFeldLen)
{
	char key;
	DrawMenu();
	do
	{
		key = getch();
		if (key == '1')
		{
			DatenAufnehmen(feldX, feldY, pFeldLen);
			DrawMenu();
		}
		else if (key == '2')
		{
			DatenAusgeben(feldX, feldY, pFeldLen);
			DrawMenu();
		}
		else if (key == '3')
		{
			DatenKorrigieren(feldX, feldY, pFeldLen);
			DrawMenu();
		}
		else if (key == '4')
		{
			DatenSpeichern(feldX, feldY, pFeldLen);
			DrawMenu();
		}
		else if (key == '5')
		{
			DatenLaden(feldX, feldY, pFeldLen);
			DrawMenu();
		}
		else if (key == '6')
		{
			DatenBerechnen(feldX, feldY, pFeldLen);
			DrawMenu();
		}
		else if (key == '7')
		{
			DatenGenerieren(feldX, feldY, pFeldLen);
			DrawMenu();
		}

	} while (key != '0' && key != 27);
}

int LeseIntZahl(char *queryText)
{
	int input;
	int scanned;
	do
	{
		printf("%s", queryText);
		scanned = scanf("%d", &input);
		if (scanned != 1) {
			printf("ERROR: Ungltige Eingabe. Bitte geben Sie eine gltige Zahl ein.\n");
		}
		while (getchar() != '\n'); // clear the input buffer
	} while (scanned != 1);
	return input;
}

double LeseDoubleZahl(char *queryText)
{
	double input;
	int scanned;
	do
	{
		printf("%s", queryText);
		scanned = scanf("%lf", &input);
		if (scanned != 1) {
			printf("ERROR: Ungltige Eingabe. Bitte geben Sie eine gltige Zahl ein.\n");
		}
		while (getchar() != '\n'); // clear the input buffer
	} while (scanned != 1);
	return input;
}

