import (
	"fmt"
	"os"
	"strconv"
)

// 
func findGCD(a, b int64) int64 {
	for b != 0 {
		// b = a % b
		// a = temp
		a, b = b, a%b
	}
	return a
}

// 
func findLCM(a, b int64) int64 {
	gcd := findGCD(a, b)
	lcm := a / gcd * b
	return lcm
}

//        
func findLCMAndGCD(num []int64) (int64, int64, error) {
	if len(num) == 0 {
		return 0, 0, fmt.Errorf("  ")
	}

	lcm := num[0]
	gcd := num[0]

	for i := 1; i < len(num); i++ {
		number := num[i]
		lcm = findLCM(lcm, number)
		gcd = findGCD(gcd, number)
	}

	return lcm, gcd, nil
}

func main() {
	nums := []string{"12", "16", "24", "36"}
	num := []int64{}

	//      +  
	for _, z := range nums {
		n, err := strconv.ParseInt(z, 10, 64)
		if err != nil {
			fmt.Println("    .")
			os.Exit(1)
		}
		num = append(num, n)

	}

	lcm, gcd, err := findLCMAndGCD(num)

	//  
	if err != nil {
		fmt.Println(":", err)
		os.Exit(1)
	}
	for _, i := range num {
		if i < 0 {
			fmt.Println("    .")
			os.Exit(1)
		}

	}

	fmt.Println(": ", lcm)
	fmt.Println(": ", gcd)
}

